import React from "react";

function List({ todo, handleModify }) {
  console.log(`여기요 ${todo}`);
  return (
    <>
      {
        todo.map((x, idx) =>{
          <p key={idx}>{x.text}</p>
        })
      }

    </>
  );
}

export default List;
